  false,\n\t\"url\": null,\n\t\"notes\": \"INCORPORATED_AREAS_INDOT_IN is a polygon
  shapefile that contains incorporated area boundaries (Cities and Towns) in Indiana,
  provided by personnel of Indiana Department of Transportation (INDOT), Graphics
  Engineering. The data set provided by INDOT was in an ESRI shapefile format and
  was named \"CORPLINE_INDOT_2003.\" INCORPORATED_AREAS_INDOT_IN is attributed with
  incorporated names (and) area and perimeter numbers. An updated version of this
  data set was provided to personnel of the IGS by INDOT personnel on September 13,
  2006. The updated data set provided was in an ESRI shapefile format, and was named
  \"GISINFO.CORPLINE.SHP.\" The following is excerpted from the metadata provided
  by INDOT, Graphics and Engineering for the source shapefile GISINFO.CORPLINE.SHP:
  \"The polygon shapefile represents the incorporated area boundaries ( Cities and
  Towns) in the State of Indiana. Approximately 568 incorporated boundaries are represented
  within this data set.\"\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
